(464,	308,	'sp_eap_upload_options',	'a:2:{s:18:\"eap_accordion_type\";s:17:\"content-accordion\";s:24:\"accordion_content_source\";a:3:{i:0;a:2:{s:23:\"accordion_content_title\";s:199:\"What is Couples Connect?                                                                           \";s:29:\"accordion_content_description\";s:390:\"Say hello to Couples Connect – your digital companion for hassle-free pre-marriage counseling in Cabuyao.\r\nWith user-friendly features for couples and smart tools for counselors, our innovative platform is set to\r\nmake your journey to the altar smoother and more enjoyable. Embrace technology, simplify the process,\r\nand let Couples Connect be your guide to a happy and thriving marriage!\";}i:1;a:2:{s:23:\"accordion_content_title\";s:33:\"What is Pre-Marriage Orientation?\";s:29:\"accordion_content_description\";s:646:\"Pre-Marriage Orientation (PMO) is a program designed to provide engaged couples with essential knowledge\r\nand skills to prepare them for marriage. It typically covers a range of topics relevant to married life, including\r\ncommunication, conflict resolution, financial management, parenting, and understanding expectations within\r\nthe marriage. The aim is to equip couples with the tools and insights needed to build a strong and lasting\r\nrelationship. Pre-marriage orientation sessions are often facilitated by trained counselors or educators and may\r\nvary in format and duration depending on the organization or institution offering the program.\";}i:2;a:2:{s:23:\"accordion_content_title\";s:32:\"What is Pre-Marriage Counseling?\";s:29:\"accordion_content_description\";s:742:\"Pre-marriage counseling is a form of therapy or guidance provided to couples who are engaged or considering\r\nmarriage. It aims to help couples explore and address potential areas of conflict, improve communication skills,\r\nunderstand each other\'s expectations and values, and develop strategies for resolving conflicts and maintaining\r\na healthy relationship. Pre-marriage counseling sessions are typically conducted by trained counselors, therapists,\r\nor religious leaders and may cover topics such as communication, conflict resolution, financial management,\r\nintimacy, family dynamics, and future goals. The goal of pre-marriage counseling is to strengthen the\r\nrelationship and prepare the couple for a successful and fulfilling marriage.\";}}}'),
